import React from 'react'

const initialState = {
    modules:[
        {_id: 123, title: "Module 123"},
        {_id: 234, title: "Module 234"},
        {_id: 345, title: "Module 345"}
    ]
}

const moduleReducer = (state=initialState, action) => {
    switch(action.type){
        case "CEATE_MODULE":
        case "FIND_MODULES_FOR_COURSE":
        case "FIND_MODULE":
        case "UPDATE_MODULE":
        case "DELETE_MODULE":
        default:
            return state
    }
}

export default moduleReducer
